import React from "react";
import "./Header.css";
const Header = () => {
  return (
    <>
      <div className="header">
        <div>
          <div className="header-top">
            <div class="d-flex justify-content-end">
                <div>1</div>
                <div>2</div>
                <div>3</div>
                <div></div>
            </div>
          </div>
        </div>
        <div className="header-bottom">B</div>
      </div>
    </>
  );
};

export default Header;
